@-moz-document domain("chat.openai.com") {
/* Change the background color of the chat area */
    .chat-container, .css-xxxxxx { /* Replace `css-xxxxxx` with the actual class */
        background-color: #f0f0f0 !important;
    }

    /* Change the text color of messages */
    .message-text, .css-yyyyyy { /* Replace `css-yyyyyy` with the actual class */
        color: #333 !important;
    }

    /* Hide the header for a less cluttered look */
    .header-container, .css-zzzzzz { /* Replace `css-zzzzzz` with the actual class */
        display: none !important;
    }

    /* Hide footer or input area if needed */
    .footer-container, .css-aaaaaa { /* Replace `css-aaaaaa` with the actual class */
        display: none !important;
    }
}
